import React from 'react';
import { Box } from '@mui/material';
import Sidebar from './DashboardLayoutNavigationLinks'; // Asegúrate de que este sea tu componente de menú
import Typography from '@mui/material/Typography';

const DashboardPageLayout = ({ navigation, children }) => {
    return (
        <AppProvider navigation={navigation} theme={demoTheme}>
            <DashboardLayout>
                <Routes>
                    {/* Rutas anidadas dentro del Dashboard */}
                    <Route path="usuarios" element={<Usuario />} />
                </Routes>
            </DashboardLayout>
        </AppProvider>
    );
};

function DemoPageContent() {
    return (
        <Box
            sx={{
                py: 35,
                display: 'flex',
                flexDirection: 'column',
                alignItems: 'center',
                textAlign: 'center',
            }}
        >
            <Typography variant="h4">Bienvenido al Gestor de Control de Calidad!</Typography>
        </Box>
    );
}
export default DashboardPageLayout;
